using System;
using System.Numerics;
using BenchmarkDotNet.Running;
using BenchmarkDotNet.Attributes;
using Microsoft.Extensions.Primitives;

namespace Benchmark
{
    public class Program
    {
        public static void Main(string[] args)
        {
            Console.WriteLine("Vector.IsHardwareAccelorated={0}  Vector<ushort>.Count={1}", Vector.IsHardwareAccelerated, Vector<ushort>.Count);
            var summary = BenchmarkRunner.Run<Program>();
            Console.WriteLine(summary);
        }
        
        [Benchmark]
        public void TestValidateHeaderValues1()
        {
            foreach (var header in _sampleHeaders)
            {
                ValidateHeaderValues1(header);
            }
        }
        
        [Benchmark]
        public void TestValidateHeaderValues2()
        {
            foreach (var header in _sampleHeaders)
            {
                ValidateHeaderValues2(header);
            }
        }
        
        [Benchmark]
        public void TestValidateHeaderValues3()
        {
            foreach (var header in _sampleHeaders)
            {
                ValidateHeaderValues3(header);
            }
        }
        
        [Benchmark]
        public void TestValidateHeaderValues4()
        {
            foreach (var header in _sampleHeaders)
            {
                ValidateHeaderValues4(header);
            }
        }
        
        public static bool ValidateHeaderValues1(StringValues headerValues)
        {
            foreach (var value in headerValues)
            {
                foreach (var ch in value)
                {
                    if (ch < 0x20)
                    {
                        return false;
                    }
                }
            }
            
            return true;
        }
        
        public static unsafe bool ValidateHeaderValues2(StringValues headerValues)
        {
            foreach (var value in headerValues)
            {
                fixed (char* pData = value)
                {
                    var length = value.Length;
                    var input = pData;
                    for (int i = 0; i < length; i++)
                    {
                        if (*(input++) < 0x20)
                        {
                            return false;
                        }
                    }
                }
            }
            
            return true;
        }
        
        private static readonly int _vectorSpan = Vector<ushort>.Count;
        private static readonly Vector<ushort> _vectorMin = new Vector<ushort>(0x20);
        
        public static bool ValidateHeaderValues3(StringValues headerValues)
        {
            foreach (var value in headerValues)
            {
                var length = value.Length;
                ushort[] chars = new ushort[length];
                System.Buffer.BlockCopy(value.ToCharArray(), 0, chars, 0, chars.Length * sizeof(char));
                var index = 0;
                
                if (Vector.IsHardwareAccelerated && length >= _vectorSpan)
                {
                    do
                    {
                        var data = new Vector<ushort>(chars, index);
                        
                        if(!Vector.LessThan(data, _vectorMin).Equals(Vector<ushort>.Zero))
                        {
                            return false;
                        }
                        index += _vectorSpan;
                        
                    } while (length - index >= _vectorSpan);
                }
                
                for (; index < length; index++)
                {
                    if (chars[index] < 0x20)
                    {
                        return false;
                    }
                }
            }
            
            return true;
        }
        
        public static bool ValidateHeaderValues4(StringValues headerValues)
        {
            foreach (var value in headerValues)
            {
                var length = value.Length;
                for (var i = 0; i < length; i++)
                {
                    if (value[i] < 0x20)
                    {
                        return false;
                    }
                }
            }
            
            return true;
        }
        
